塗り込み不要で抜群の撥水効果!ワンステップでできるガラスクリーナー&撥水コート<br>
<br>
●ワンステップで透明感のあるクリアな視界と抜群の撥水効果を実現します。<br>
●雨や雪をはじくと同時に、鳥のフンや虫の死骸、霜などがガラスに固着するのを防ぎます。<br>
●成分:撥水剤、水性洗浄剤、アルコール類、水<br>
●液性:弱酸性<br>
●内容量:651ml<br>
●製品サイズ(H×W×D):273×101×58(mm)<br>
●製品重量:711g<br>
